import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import '../styles/About.cssabout.css';

const About = () => {
  return (
    <div className="app">
      <Header />
      <main className="about-page">
        <h1 className="page-title">О БРЕНДЕ LINING</h1>
        <div className="about-content">
          <p>LinIng — это инновационный бренд спортивной одежды и обуви, основанный в 2024 году...</p>
          <img src="../assets/team.jpg" alt="Наша команда" />
        </div>
      </main>
      <Footer />
    </div>
  );
};

export default About;
